	public selectEmployee(id: number) {
		this.$emit('details', id);
	}
	public minToHour(minutos: number) {
		const hora = Math.trunc(minutos / 60);
		const tmpmin = (minutos / 60) % 1;
		const min = tmpmin * 60;
		return hora + 'h:' + min + 'min';
	}

